import React from 'react';
import styled from 'styled-components';

const NavButton = styled.button`
  width: 50px;
  height: 50px;
  border-radius: 50%;
  border: none;
  outline: none;
`;

const Navigaition = () => {
  return <NavButton />;
};

export default Navigaition;
